import React from "react";

function Profile({info}) {

    
  return (
    <div>
      {info.map((el) => (
        <h1>Name : {el.name='houcem'}</h1>
      ))}
      {info.map((el) => (
        <h1>Bio : {el.bio}</h1>
      ))}
      {info.map((el) => (
        <h1>Profession : {el.profession}</h1>
      ))}
      {info.map((el) => (
        <img src="https://thumbs.dreamstime.com/b/businessman-icon-vector-male-avatar-profile-image-profile-businessman-icon-vector-male-avatar-profile-image-182095609.jpg"></img>
      ))}
    </div>
  );
}

export default Profile;
